import NewPost from "./form/NewPost";
import Post from "./Post";
import { useState } from "react";
import Axios from "axios";
import "./Grupos.modules.css";
import Navbar from "./layout/Navbar";
import Footer from "./layout/Footer";
import React from 'react'
import perfilGrupo from './imagensGrupo';

function Grupos(){
  // javascripto
    const [postList, setPostList] = useState([]);

    const getPosts = () => {
      Axios.get("http://localhost:3001/posts").then((response) => { //pega os dados do backend
        //console.log("Função getPosts: ", postList);
        setPostList(response.data);
    });
    }

    getPosts();

    // html e css
    return ( 
        <div className="feedGrupos">
          <Navbar />
          <div className="perfilGrupo">
            <div className="fotoGrupo">
              <img src={perfil_fybs.png}/>
            </div>
            <div className="infoGrupo"></div>
            <p>aqui dicara o perfil do grupo!!</p>

          </div>
          
          <NewPost />
         
          {postList.map((val, key) => {
            return (
              <Post user={'@' + val.userName} texto={val.text}/>
            )
          })}

        <div className="row py-5 px-4"> <div className="col-md-5 mx-auto">
          <div className="bg-white shadow rounded overflow-hidden">
            <div className="px-4 pt-0 pb-4 cover">
              <div className="media align-items-end profile-head">
                <div className="profile mr-3">
                  {/*<img src="https://br.pinterest.com/MizuchixD/perfil-do-discord/" alt="..." width="130" className="rounded mb-2 img-thumbnail">*/}
                    <a href="#" className="btn btn-outline-dark btn-sm btn-block">Edit profile</a>
                </div>
                <div className="media-body mb-5 text-white">
                  <h4 className="mt-0 mb-0">Mark Williams</h4>
                  <p className="small mb-4"><i className="fas fa-map-marker-alt mr-2"></i>New York</p>
                </div>
              </div>
            </div>
            <div className="bg-light p-4 d-flex justify-content-end text-center">
              <ul className="list-inline mb-0">
                <li className="list-inline-item">
                  <h5 className="font-weight-bold mb-0 d-block">215</h5>
                  <small className="text-muted">
                    <i className="fas fa-image mr-1">
                    </i>Photos</small> </li>
                <li className="list-inline-item">
                  <h5 className="font-weight-bold mb-0 d-block">745</h5>
                  <small className="text-muted"><i className="fas fa-user mr-1"></i>Followers</small>
                </li>
                <li className="list-inline-item">
                  <h5 className="font-weight-bold mb-0 d-block">340</h5>
                  <small className="text-muted"> <i className="fas fa-user mr-1"></i>Following</small>
                </li>
              </ul>
            </div>
            <div className="px-4 py-3">
              <h5 className="mb-0">About</h5>
              <div className="p-4 rounded shadow-sm bg-light">
                <p className="font-italic mb-0">Web Developer</p>
                <p className="font-italic mb-0">Lives in New York</p>
                <p className="font-italic mb-0">Photographer</p>
              </div>
            </div>
            <div className="py-4 px-4">
              <div className="d-flex align-items-center justify-content-between mb-3">
                <h5 className="mb-0">Recent photos</h5>
                <a href="#" className="btn btn-link text-muted">Show all</a>
              </div> <div className="row">
                <div className="col-lg-6 mb-2 pr-lg-1">
                  {/*<img src="" alt="" className="img-fluid rounded shadow-sm">*/}
                </div>
                <div className="col-lg-6 mb-2 pl-lg-1">
                  {/*<img src="https://maisgeek.com/como-alterar-sua-foto-de-perfil-do-discord/" alt="" className="img-fluid rounded shadow-sm">*/}
                </div> <div className="col-lg-6 pr-lg-1 mb-2">
                  {/*<img src="https://maisgeek.com/como-alterar-sua-foto-de-perfil-do-discord/" alt="" className="img-fluid rounded shadow-sm">*/}
                </div> <div className="col-lg-6 pl-lg-1">
                  {/*<img src="https://maisgeek.com/como-alterar-sua-foto-de-perfil-do-discord/" alt="" className="img-fluid rounded shadow-sm">*/}
                </div>
              </div>
            </div>
          </div>
        </div>
</div>

        < Footer />
        </div>  
        
    )
}

export default Grupos;
